import React from "react";

const ProductCard = ({ item }) => {
  return (
    <div>
      <img src={item?.img} alt="" />
      <div>Conscious Choice</div>
      <div>{item?.title}</div>
      <div>₩ {item?.price}</div>
      <div>신제품</div>
    </div>
  );
};

export default ProductCard;
